# # test SVM
y_true = []
y_pred = []
for x, y in zip(dataTest, targetTest):
	y_true.append(y)
	y_pred.append(lin_clf.predict([x]))

print(confusion_matrix(y_true, y_pred))
print(accuracy_score(y_true, y_pred))
